	<title>Color swatches</title>

	<link rel="stylesheet" href="stylesheet-lab.css">

	<style>
		html, body {
			background-color: rgb(127,127,127);
		}

		.swatch {
			display: flex;
			flex-direction: row;
			width: 400px;
			height: 50px;
			margin-bottom: 1px;
		}

		.swatch div {
			width: 100px;
			height: 50px;
		}

		.heading {
			background-color: rgb(127,127,127);
			display: flex;
			flex-direction: row;
			width: 400px;
			height: 50px;
			position: sticky;
			top: 0;
		}

		.heading div {
			border-left: 1px solid black;
			border-right: 1px solid black;
			width: 98px;
			padding-top: 16px;
			text-align: center;
		}
	</style>
</head>
